description:
Top notch anchorman, Ron Burgundy (Jack Lawrence) has moved his roots from San Diego to the fine trappings of Los Angeles, CA -- and he has brought the entire Channel 4 News Team with him! Unfortunately, Brian (Dale DaBone), Brick (Anthony Rosano), and Champ (Eric Masterson) are all unemployed as well. In an effort to restart their once stellar careers, the gang and their fearless leader must join forces with the ever-popular Veronica Corningstone (Tasha Reign) and her all-female team. Can they play &quot;second fiddle&quot; to the ladies? Or is it the ideal news story? No matter what, Ron is getting laid and getting paid...and that goes for everyone!

